webpackJsonp([0x5f2374e5b30a],{3384:function(t,a){t.exports={data:{markdownRemark:{html:"<p><strong>🌡25℃ ☁</strong></p>\n<p>起きてから一時間ほどテレビを見て、ゴミ出しの手伝いをして、少しゆっくりしていたら、今度は買い出しを頼まれました。\n特に用事もなく引き受けましたが、途中 U 君と会いました。</p>\n<p>話の流れで午後遊ぶこととなり、一旦別れて買い出しを済ませ、昼食を取ってから U 君の家へ。\n少しだけファミコンやってから、庭で水遊びをやって、そして近くの山で遊びました。</p>\n<p>山、と言っても駅近くの団地造成中にできた盛土のことで、ほとんど高さ 2m 前後ですが、最大のものは 6 〜 7m くらいありました。</p>",frontmatter:{cover:null,date:"1990-06-11T21:20:00+09:00",strDate:"1990/6/11",title:"日記"}}},pathContext:{path:"/ja/blog/1990/06/11-diary/",langKey:"ja"}}}});
